import {createRouter} from "vue-router";
import homeComponent from "../views/homeComponent.vue";

const router = createRouter({
    mode: 'history',
    base: process.env.BASE_URL,
    routes: [
        { path: '/', component: homeComponent }
    ]
})

export default router
